import React, { useState, useEffect } from 'react';
import { ScrollView, StyleSheet, Text, View, Button, TextInput, Image, SafeAreaView, TouchableOpacity, StatusBar, Alert } from "react-native";
import { auth } from '../config/firebase';
import { getFirestore, doc, updateDoc, onSnapshot } from 'firebase/firestore';
import * as ImagePicker from 'expo-image-picker';

const pickImage = async () => {
let result = await ImagePicker.launchImageLibraryAsync({
mediaTypes: ImagePicker.MediaTypeOptions.Images,
allowsEditing: true,
aspect: [1, 1],
quality: 0.5,
});

if (!result.cancelled) {
setImageUrl(result.uri);
}
};

const defaultAvatar = require("../assets/defaultAvatar.png");

export default function Profile() {
  const [name, setName] = useState('');
  const [categorieAge, setcategorieAge] = useState('');
  const [dateAge, setdateAge] = useState('');
  const [positionPlayer, setpositionPlayer] = useState('');
  const [footPlayer, setfootPlayer] = useState('');
  const [taillePlayer, settaillePlayer] = useState('');
  const [poidsPlayer, setpoidsPlayer] = useState('');
  const [clubPlayer, setclubPlayer] = useState('');
  const [butPlayer, setbutPlayer] = useState('');
  const [assistPlayer, setassistPlayer] = useState('');
  const [storieclubPlayer, setstorieclubPlayer] = useState('');
  const [socialPlayer, setsocialPlayer] = useState('');
  const [email, setEmail] = useState('');
  const [imageUrl, setImageUrl] = useState(null);

  const firestore = getFirestore();
  const userDocRef = doc(firestore, "users", auth.currentUser.uid);

  useEffect(() => {
	const unsubscribe = onSnapshot(userDocRef, (doc) => {
	  if (doc.exists()) {
		const data = doc.data();
		setName(data.name);
		setcategorieAge(data.categorieAge);
		setdateAge(data.dateAge);
		setpositionPlayer(data.positionPlayer);
		setfootPlayer(data.footPlayer);
		settaillePlayer(data.taillePlayer);
		setpoidsPlayer(data.poidsPlayer);
		setclubPlayer(data.clubPlayer);
		setbutPlayer(data.butPlayer);
		setassistPlayer(data.assistPlayer);
		setstorieclubPlayer(data.storieclubPlayer);
		setsocialPlayer(data.socialPlayer);
		setEmail(data.email);
		setImageUrl(data.imageUrl);
	  } else {
		console.log("No such document!");
	  }
	});
	return unsubscribe;
  }, []);

  const onUpdateProfile = async () => {
	try {
	  await updateDoc(userDocRef, {
		name,
		categorieAge,
		dateAge,
		positionPlayer,
		footPlayer,
		taillePlayer,
		poidsPlayer,
		clubPlayer,
		butPlayer,
		assistPlayer,
		storieclubPlayer,
		socialPlayer,
		email,
		imageUrl,
	  });
	  Alert.alert("Profile updated successfully!");
	} catch (error) {
	  console.error("Error updating profile: ", error);
	  Alert.alert("Error updating profile!");
	}
  };

  const pickImage = async () => {
	  let result = await ImagePicker.launchImageLibraryAsync({
		mediaTypes: ImagePicker.MediaTypeOptions.All,
		allowsEditing: true,
		aspect: [4, 3],
		quality: 1,
	  });

	  console.log(result);

	  if (!result.cancelled) {
		setImageUrl(result.uri);
	  }
	};

  return (
<ScrollView 
     keyboardShouldPersistTaps="always"
     style={{flexGrow: 1}}>
	 <View Style={styles.container}>
	  <View style={styles.profileInfo}>
		<TouchableOpacity onPress={pickImage}>
		  {imageUrl ? (
			<Image source={{ uri: imageUrl }} style={styles.avatar} />
		  ) : (
			<Image source={defaultAvatar} style={styles.avatar} />
		  )}
		</TouchableOpacity>

		<View style={styles.profileDetails}>
		<TouchableOpacity style={[styles.updateButton, styles.shadowProp]} onPress={onUpdateProfile}>
			<Text style={styles.updateButtonText}>Mettre à jour</Text>
		  </TouchableOpacity>
		  <Text style={styles.label}>Name:</Text>
		  <TextInput
			style={[styles.input, styles.shadowProp]}
			placeholder="Enter your name"
			value={name}
			onChangeText={setName}
		  />
		  <Text style={styles.label}>Catégorie d'âge:</Text>
			<TextInput
			  style={[styles.input, styles.shadowProp]}
			  placeholder="Catégorie d'âge du joueur (U9, U11, U13, etc.)"
			  value={categorieAge}
			  onChangeText={setcategorieAge}
			/>
			<Text style={styles.label}>Position:</Text>
			<TextInput
			  style={[styles.input, styles.shadowProp]}
			  placeholder="Poste occupé par le joueur sur le terrain"
			  value={positionPlayer}
			  onChangeText={setpositionPlayer}
			/>
			<Text style={styles.label}>Pied préférentiel:</Text>
			<TextInput
			  style={[styles.input, styles.shadowProp]}
			  placeholder="Pied préférentiel du joueur (gauche/droit)"
			  value={footPlayer}
			  onChangeText={setfootPlayer}
			/>
			<Text style={styles.label}>Taille:</Text>
			<TextInput
			  style={[styles.input, styles.shadowProp]}
			  placeholder="Taille du joueur en centimètres"
			  value={taillePlayer}
			  onChangeText={settaillePlayer}
			/>
			<Text style={styles.label}>Poids:</Text>
			<TextInput
			  style={[styles.input, styles.shadowProp]}
			  placeholder="Poids du joueur en kilogrammes"
			  value={poidsPlayer}
			  onChangeText={setpoidsPlayer}
			/>
			<Text style={styles.label}>Club actuel:</Text>
			<TextInput
			  style={[styles.input, styles.shadowProp]}
			  placeholder="Nom du club auquel le joueur appartient actuellement"
			  value={clubPlayer}
			  onChangeText={setclubPlayer}
			/>
			<Text style={styles.label}>Statistiques de but:</Text>
			<TextInput
			  style={[styles.input, styles.shadowProp]}
			  placeholder="Statistiques (nombre de buts)"
			  value={butPlayer}
			  onChangeText={setbutPlayer}
			/>
			<Text style={styles.label}>Statistiques d'assistances:</Text>
			<TextInput
			  style={[styles.input, styles.shadowProp]}
			  placeholder="Statistiques (nombre d'assistances)"
			  value={assistPlayer}
			  onChangeText={setassistPlayer}
			/>
			<Text style={styles.label}>Historique des clubs:</Text>
			<TextInput
			  style={[styles.input, styles.shadowProp]}
			  placeholder="Historique des clubs dans lesquels le joueur a évolué"
			  value={storieclubPlayer}
			  onChangeText={setstorieclubPlayer}
			/>
			<Text style={styles.label}>Réseaux sociaux:</Text>
			<TextInput
			  style={[styles.input, styles.shadowProp]}
			  placeholder="Liens vers les profils de réseaux sociaux du joueur"
			  value={storieclubPlayer}
			  onChangeText={setstorieclubPlayer}
			/>
			<Text style={styles.label}>Date de naissance:</Text>
			<TextInput
			  style={[styles.input, styles.shadowProp]}
			  placeholder="Date de naissance du joueur"
			  value={dateAge}
			  onChangeText={setdateAge}
			/>
		  <Text style={styles.label}>Email:</Text>
		  <TextInput
			style={[styles.input, styles.shadowProp]}
			placeholder="Enter your email"
			value={email}
			onChangeText={setEmail}
		  />
		</View>
	  </View>
	  </View>
	</ScrollView>
  );
}

const styles = StyleSheet.create({
  container: {
	flex: 1,
	backgroundColor: "#F6F7FB",
	alignItems: "center",
	justifyContent: "flex-start",
	paddingTop: StatusBar.currentHeight,
	height: '100%',
  },
  header: {
	width: "100%",
	backgroundColor: "#F6F7FB",
	height: 50,
	justifyContent: "center",
	alignItems: "center",
  },
  headerText: {
	color: "#fff",
	fontWeight: "bold",
	fontSize: 20,
  },
  profileInfo: {
	flexDirection: "column",
	marginVertical: 20,
	alignItems: "center",
  },
  avatar: {
	width: 120,
	height: 120,
	borderRadius: 60,
  },
  profileDetails: {
	flex: 1,
	marginLeft: 20,
	marginRight: 20,
  },
  label: {
	fontWeight: "regular",
	marginVertical: 10,
	fontSize: 16,
	},
	input: {
	backgroundColor: "#fff",
	  height: 45,
	  marginBottom: 15,
	  fontSize: 16,
	  borderRadius: 10,
	  padding: 12,
	},
	updateButton: {
	backgroundColor: '#0f3b7a',
	  borderRadius: 10,
	  height: 45,
	  justifyContent: 'center',
	  alignItems: 'center',
	  marginTop: 10,
	},
	updateButtonText: {
	color: "#fff",
	fontWeight: "bold",
	fontSize: 16,
	},
	shadowProp: {
	  shadowColor: '#000',
	  shadowOffset: {
	  width: 0,
	  height: 2,
	  },
	  shadowOpacity: 0.23,
	  shadowRadius: 2.62,
	  elevation: 4,
	  },
	});
